import React, { Component } from 'react';

class Header extends Component {

constructor(props) 
{
		super(props);
		this.state = {
			accounts: this.props.accounts
		};

    alert(
        `In the component ` + this.props.accounts[0]
      	);

}
  render() {
    return (

	<div>Your account number is: {this.state.accounts}</div>

	);
  }
}

export default Header;
